import React, {useState} from 'react';
import {useAuth} from './AuthContext';

export default function Signup(){
    const {signup} = useAuth();

    function handleOnClick(e){
        e.preventDefault();

    }

    return(
        <>
            <h4> Sign Up! IDIOT</h4>
            <form>
                <input type='text' id='alias' placeholder='Username'/> <br/>
                <input type='password' id='password' placeholder='Password'/> <br/>
                <input type='password' id='password-confirm' placeholder='Confirm Password'/> <br/>
                <input type='text' id='firstname' placeholder='First Name'/> <br/>
                <input type='text' id='lastname' placeholder='Last Name'/> <br/>
                <input type='text' id='age' placeholder='Age'/> <br/>
                <input type='text' id='height-feet' placeholder='Height (ft)'/> <br/>
                <input type='text' id='height-inch' placeholder='Height (inch)'/> <br/>
                <input type='text' id='lbs' placeholder='Weight (lbs)'/> <br/>
                <input type='submit' value='Sign Up' onClick={handleOnClick}/>
            </form>
        </>
    );

}
